import React, { useState } from "react";
import {
  Box,
  Typography,
  TextField,
  Button,
  MenuItem,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Grid,
  Avatar,
} from "@mui/material";

function FileUpload() {
  const [selectedAudioFile, setSelectedAudioFile] = useState(null);
  const [selectedMidiFile, setSelectedMidiFile] = useState(null);
  const [selectedFormat, setSelectedFormat] = useState("");
  const [openPopup, setOpenPopup] = useState(false);
  const [artistCounts, setArtistCounts] = useState({
    artist1: 0,
    artist2: 0,
    artist3: 0,
    artist4: 0,
    artist5: 0,
    artist6: 0,
  });

  const handleAudioFileChange = (event) => {
    setSelectedAudioFile(event.target.files[0]);
  };

  const handleMidiFileChange = (event) => {
    setSelectedMidiFile(event.target.files[0]);
  };

  const handleFormatChange = (event) => {
    setSelectedFormat(event.target.value);
  };

  const handleUpload = () => {
    // Handle file upload logic
    console.log("Audio file uploaded:", selectedAudioFile);
    console.log("MIDI file uploaded:", selectedMidiFile);
    console.log("Selected format:", selectedFormat);

    // Increment the count for the selected artist
    const updatedCounts = { ...artistCounts };
    const selectedArtist = `artist${Math.floor(Math.random() * 6) + 1}`;
    updatedCounts[selectedArtist]++;
    setArtistCounts(updatedCounts);

    setOpenPopup(true);
  };

  const handleClosePopup = () => {
    setOpenPopup(false);
  };

  return (
    <Box
      sx={{
        height: "100vh",
        maxWidth: 400,
        margin: "auto",
        marginTop: 10,
        padding: 2,
        "& > *": {
          marginBottom: 2,
        },
      }}
    >
      <Typography variant="h4" align="center" gutterBottom color="black">
        File Upload
      </Typography>
      <input
        type="file"
        accept="audio/*"
        onChange={handleAudioFileChange}
        style={{ display: "none" }}
        id="audio-file-input"
      />
      <input
        type="file"
        accept=".mid,.midi"
        onChange={handleMidiFileChange}
        style={{ display: "none" }}
        id="midi-file-input"
      />
      <Box>
        <label htmlFor="audio-file-input">
          <Button variant="contained" component="span" fullWidth>
            {selectedAudioFile ? "Audio File Selected" : "Select Audio File"}
          </Button>
        </label>
      </Box>
      <Box>
        <label htmlFor="midi-file-input">
          <Button variant="contained" component="span" fullWidth>
            {selectedMidiFile ? "MIDI File Selected" : "Select MIDI File"}
          </Button>
        </label>
      </Box>
      <TextField
        select
        fullWidth
        label="Select Format"
        value={selectedFormat}
        onChange={handleFormatChange}
        margin="normal"
      >
        <MenuItem value="format1">WAV</MenuItem>
        <MenuItem value="format2">UpScaling</MenuItem>
        <MenuItem value="format3">SVS</MenuItem>
      </TextField>
      <Button
        variant="contained"
        color="primary"
        fullWidth
        onClick={handleUpload}
        disabled={!selectedAudioFile || !selectedMidiFile || !selectedFormat}
      >
        Upload
      </Button>

      {/* Popup Dialog */}
      <Dialog open={openPopup} onClose={handleClosePopup}>
        <DialogTitle>Artist Upload Counts</DialogTitle>
        <DialogContent>
          <Grid container spacing={2}>
            {Object.keys(artistCounts).map((artist, index) => (
              <Grid item xs={4} key={index}>
                <Avatar
                  alt={artist}
                  src={`artist_${index + 1}.jpg`}
                  sx={{ width: 100, height: 100, margin: "auto" }}
                />
                <Typography variant="subtitle1" align="center">
                  {artist}
                </Typography>
                <Typography
                  variant="subtitle2"
                  align="center"
                >{`Uploaded: ${artistCounts[artist]} times`}</Typography>
              </Grid>
            ))}
          </Grid>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClosePopup} color="primary">
            Close
          </Button>
        </DialogActions>
      </Dialog>
    </Box>
  );
}

export default FileUpload;
